import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';


import Route from './routes'

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          </header>
          <div>

          </div>

          <Route/>
      </div>
    );
  }
}

